  `created_by` int(10) unsigned NOT NULL DEFAULT '1001',
  `updated_by` int(10) unsigned NOT NULL DEFAULT '1001',
  `created_at` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00',
  `updated_at` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00',
  `deleted_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `vehicle_varient_id_foreign` (`model_id`),
  KEY `vehicle_category_id_foreign` (`category_id`),
  CONSTRAINT `vehicle_category_id_foreign` FOREIGN KEY (`category_id`) REFERENCES `scb_common_attributes` (`id`),
  CONSTRAINT `vehicle_varient_id_foreign` FOREIGN KEY (`model_id`) REFERENCES `scb_common_attributes` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=9 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

